// @flow
import React from 'react';
import { Colors } from 'class101-ui';

const style = {
  padding: '6px 12px',
};

const Component = () => (
  <div>
    <div style={{ ...style, backgroundColor: Colors.gray900, color: Colors.white }}>
      { `gray900 (${Colors.gray900})` }
    </div>
  </div>
);

export default Component;
